        addSampleCoordinates(shapePosition, sampleDatas[0]);
    #else
        getOctreeLeafSampleDatas(nodeData, traversalData.octreeCoords, sampleDatas);
        addSampleCoordinates(shapePosition, sampleDatas[0]);
        addSampleCoordinates(shapePosition, sampleDatas[1]);
